  }
  render() {
    const {newsarr}=this.state
    return (
        <ul>
       {
        newsarr.map((obj)=>{
          return(
            <li key={obj.id}>
              <Link to={`/deail?id=${obj.id}&title`}>
              {obj.title}
              </Link>
            </li>
          )
        })
       }
    </ul>
    )
  }
}
